measurements.description:
Two hundred fifty shapely and deeply colored flowers 23 graceful inflorescences to 42.6cm long;
	plant exceptionally well-flowered, 120cm tall, 106cm wide, grown in a 28cm black plastic pot;
	sepals and petals solid deep purple; lip deep purple, black-purple centrally; column deep purple, anther cap white;
	substance average; texture satiny.
